import React, {Component} from 'react';
import {Link} from "react-router-dom";
import {Container,Row, Col, Button, Header, Nav, Navbar, Dropdown} from "react-bootstrap";
class HeaderMain extends Component {
    render() {
        return (
                <Navbar>
                    <Container>
                    <Nav className="me-auto">
                    <Nav.Link href="/"> Strona Glowna</Nav.Link>
                    <Nav.Link href="/About-us">O nas</Nav.Link>
                    <NavDropdown title="Wycieczki" id="basic-nav-dropdown">

                    </NavDropdown>
                    <Nav.Link href="/Excursions">Wycieczki</Nav.Link>
                    <Nav.Link href="/Opinions">Opinie</Nav.Link>
                    <Nav.Link href="Contact">Kontakt</Nav.Link>
                     
                    </Nav>
                    </Container>
                </Navbar>

            
        );
    }
}

export default HeaderMain;
